Boruty is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Belsk%20Du%C5%BCy"&gt;Gmina Belsk Duży&lt;/a&gt;, within &lt;a href="Gr%C3%B3jec%20County"&gt;Grójec County&lt;/a&gt;, &lt;a href="Masovian%20Voivodeship"&gt;Masovian Voivodeship&lt;/a&gt;, in east-central Poland. It lies approximately south-east of &lt;a href="Belsk%20Du%C5%BCy"&gt;Belsk Duży&lt;/a&gt;, south of &lt;a href="Gr%C3%B3jec"&gt;Grójec&lt;/a&gt;, and south of &lt;a href="Warsaw"&gt;Warsaw&lt;/a&gt;.
